import React,{useEffect} from 'react'
import axios from 'axios';


export default function Characters(){

    const [chinese, setChinese] = React.useState([])
    React.useEffect(() =>{ 
        axios.get('http://localhost:5000/chinese/')
      .then(response => {
        setChinese({ chinese: response.data })
      })
      .catch((error) => {
        console.log(error);
      })

    }, []);
    return(
        <div>
            Characters
        </div>
    )

};
